import { Facebook, Instagram, MailOutline, Phone, Room, Twitter } from '@material-ui/icons'
import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
    display: flex;
`
const Left = styled.div`
    flex:1;
    display: flex;
    flex-direction: column;
    padding: 20px;
`
const Logo = styled.h1``
const Desc = styled.p`
    margin: 20px 0px;
`
const SocialContainer = styled.div`
    display: flex;
`
const SocialIcon = styled.div`
    width:40px;
    height: 40px;
    border-radius: 50%;
    color:white;
    background-color: #${props=>props.color};
    display:flex;
    align-items: center;
    justify-content: center;
    margin-right: 20px;
`



const Center = styled.div`
    flex:1;
    padding: 20px;
`

const Title= styled.h3`
    margin-bottom: 30px;
`
const List= styled.ul`
    margin:0;
    padding:0;
    list-style:none;
    display:flex;
    flex-wrap: wrap;
`

const ListItem= styled.li`
    width: 50%;
    margin-bottom:10px;
`

const Right = styled.div`
    flex:1;
    padding: 20px;
`
const ContactItem = styled.div`
    margin-bottom: 20px;
    display:flex;
    align-items:center;
`


function Footer() {
  return (
    <Container>
        <Left>
            <Logo>HEALER</Logo>
            <Desc>
                Lorem ipsum dolor sit amet consectetur, adipisicing elit. Vel minus ab, excepturi adipisci iure ratione!
            </Desc>
            <SocialContainer>
                <SocialIcon color="3B5999">
                    <Facebook/>
                </SocialIcon>
                <SocialIcon color="E4405F">
                    <Instagram/>
                </SocialIcon>
                <SocialIcon color="55ACEE">
                    <Twitter/>
                </SocialIcon>
            </SocialContainer>
        </Left>
        <Center>
            <Title>Navigation</Title>
            <List>
                <ListItem>Home</ListItem>
                <ListItem>Cart</ListItem>
                <ListItem>Man</ListItem>
                <ListItem>Woman</ListItem>
                <ListItem>Accesroies</ListItem>
                <ListItem>My Account</ListItem>
                <ListItem>Order Tracking</ListItem>
                <ListItem>Wishlist</ListItem>
                <ListItem>About</ListItem>
            </List>
        </Center>
        <Right>
            <Title>Contact</Title>
            <ContactItem>
               <Room style={{marginRight:"10px"}}/> Lorem, ipsum dolor. Kartal,Istanbul/Turkey
            </ContactItem>
            <ContactItem>
                <Phone style={{marginRight:"10px"}}/> +90-65456-5646-56465
            </ContactItem>
            <ContactItem>
                <MailOutline style={{marginRight:"10px"}}/> Loremipsumdolor@dolor.com
            </ContactItem>

        </Right>
    </Container>
  )
}

export default Footer
